// Действия для работы с счетчиком
export const increment = () => ({
    type: 'INCREMENT',
});

export const decrement = () => ({
    type: 'DECREMENT',
});

export const incrementByTen = () => ({
    type: 'INCREMENT_BY_TEN',
});

export const decrementByTen = () => ({
    type: 'DECREMENT_BY_TEN',
});

export const reset = () => ({
    type: 'RESET',
});
